import React from 'react';
import Moment from 'react-moment';
import momentjs from 'moment';

class Modified extends React.Component {
    render() {
        var now = momentjs();
        var d = momentjs(this.props.LastModifiedTime).fromNow();
        var diff = now.diff(d);
        console.log(diff);
        const r = <Moment date={this.props.LastModifiedTime} durationFromNow unit="days" />;
        //<span className="badge badge-light">last modifed <Moment fromNow>{this.props.LastModifiedTime}</Moment></span>;
        return r;
    }
}

export default Modified;
